import React from 'react';
import Container from 'react-bootstrap/esm/Container';
import { Link } from 'react-router-dom';
import Masonry, { ResponsiveMasonry } from 'react-responsive-masonry';

function SearchedItems({ item }) {
  return (
    <div className="listings  border-bottom  p-2 ">
      <div className="listing">
        <img
          src={item?.kitchenImg}
          alt={item?.kitchenName}
          className="listing-image"
        />
        <div className="listing-info">
          <h3>{item.kitchenName}</h3>
          <Link className="text-success">{item?.timeOpen} </Link>
          <span>{item.address}</span>
          <span>{`${item.km}km away`}</span>
          <span className="text-danger">{item.status}</span>
        </div>
      </div>
    </div>
  );
}

export default SearchedItems;
